import{_ as t,c as r,S as a,o as i}from"./chunks/framework.Nq6kOwAg.js";const u=JSON.parse('{"title":"快速开始","description":"","frontmatter":{},"headers":[],"relativePath":"guide/index.md","filePath":"guide/index.md"}'),n={name:"guide/index.md"};function o(s,e,h,l,d,p){return i(),r("div",null,e[0]||(e[0]=[a('<h1 id="快速开始" tabindex="-1">快速开始 <a class="header-anchor" href="#快速开始" aria-label="Permalink to &quot;快速开始&quot;">​</a></h1><h2 id="介绍" tabindex="-1">介绍 <a class="header-anchor" href="#介绍" aria-label="Permalink to &quot;介绍&quot;">​</a></h2><p>Tune UI 是一个基于 Vue 3 的轻量级 UI 组件库，专为现代前端应用程序设计。它提供了丰富的组件，覆盖了常见的 UI 交互场景，帮助开发者快速构建出美观且功能丰富的用户界面。</p><p>我们的设计目标是提供一套简洁、高效、可定制的组件系统，让前端开发变得更加轻松愉快。</p><h2 id="特性" tabindex="-1">特性 <a class="header-anchor" href="#特性" aria-label="Permalink to &quot;特性&quot;">​</a></h2><ul><li><strong>基于 Vue 3</strong>：充分利用 Vue 3 的 Composition API 和响应式系统</li><li><strong>TypeScript 支持</strong>：提供完整的类型定义，提升开发体验</li><li><strong>按需引入</strong>：支持组件按需引入，减小打包体积</li><li><strong>主题定制</strong>：灵活的主题配置，满足不同项目需求</li><li><strong>国际化</strong>：内置多语言支持，轻松实现全球化</li><li><strong>现代构建系统</strong>：基于 Vite 的高效开发与构建体验</li></ul><h2 id="环境支持" tabindex="-1">环境支持 <a class="header-anchor" href="#环境支持" aria-label="Permalink to &quot;环境支持&quot;">​</a></h2><p>Tune UI 组件库支持现代浏览器，不支持 IE 浏览器。</p><table><thead><tr><th><img src="https://cdn.jsdelivr.net/npm/@browser-logos/edge/edge_32x32.png" alt="Edge" width="24px" height="24px"><br>Edge</th><th><img src="https://cdn.jsdelivr.net/npm/@browser-logos/firefox/firefox_32x32.png" alt="Firefox" width="24px" height="24px"><br>Firefox</th><th><img src="https://cdn.jsdelivr.net/npm/@browser-logos/chrome/chrome_32x32.png" alt="Chrome" width="24px" height="24px"><br>Chrome</th><th><img src="https://cdn.jsdelivr.net/npm/@browser-logos/safari/safari_32x32.png" alt="Safari" width="24px" height="24px"><br>Safari</th></tr></thead><tbody><tr><td>Edge ≥ 109</td><td>Firefox ≥ 102</td><td>Chrome ≥ 109</td><td>Safari ≥ 16.3</td></tr></tbody></table><h2 id="版本" tabindex="-1">版本 <a class="header-anchor" href="#版本" aria-label="Permalink to &quot;版本&quot;">​</a></h2><p>Tune UI 的版本策略遵循 <a href="https://semver.org/lang/zh-CN/" target="_blank" rel="noreferrer">Semantic Versioning 2.0.0</a>。</p><p>当前最新版本：<a href="https://www.npmjs.com/package/tune-ui" target="_blank" rel="noreferrer"><img src="https://img.shields.io/npm/v/tune-ui.svg" alt="npm"></a></p><h2 id="准备工作" tabindex="-1">准备工作 <a class="header-anchor" href="#准备工作" aria-label="Permalink to &quot;准备工作&quot;">​</a></h2><p>在使用 Tune UI 组件库前，请确保你已了解 Vue 3 的基础知识，特别是组合式 API 和单文件组件。</p><p>Tune UI 使用 Vite 构建，推荐你在项目中也使用 Vite 作为构建工具。如果你是 Vue 3 的新手，我们建议你先阅读 <a href="https://cn.vuejs.org/" target="_blank" rel="noreferrer">Vue 3 官方文档</a>。</p><h2 id="下一步" tabindex="-1">下一步 <a class="header-anchor" href="#下一步" aria-label="Permalink to &quot;下一步&quot;">​</a></h2><p>请前往 <a href="/tune-ui/guide/installation/">安装使用</a> 了解如何在项目中集成 Tune UI 组件库。</p>',17)]))}const c=t(n,[["render",o]]);export{u as __pageData,c as default};
